// @updateURL https://update.greasyfork.org/scripts/455464/Marketing%20on%20wykop.meta.js
// ==/UserScript==

/* jshint esversion: 6 */


function initCSS() {
  const ele= document.createElement('style');
  ele.type = 'text/css';
  ele.innerHTML = `
     .marketing.warning{
     color:red;
     font-weight: bold;
     font-size: 12px;
     }
    .marketing-highlight {
        border: 2px solid #ff6c6c !important;
				position: relative;
				background-color: #fff1f1 !important;
    }
    .marketing-highlight .article:before {
        position: absolute;
				display: block;
				left: 25px;
				top:100px;
				content: '';
				background-image: url('data:image/svg+xml;base64,');
         background-repeat: no-repeat;
        width: 30px;
        height: 30px;
        background-size: 30px;
    }
   @media only screen and (max-width: 720px) {
    .marketing-highlight .article:before {
      right: 10px;
      top: 10px;
      left: auto;
    }
    }
  `;
  document.head.appendChild(ele);
}

initCSS();

const stopWebsites = ['legaartis.pl', 'tass.com', 'rt.com', 'alternews.pl', 'alexjones.pl', 'dziennik-polityczny.com', 'magnapolonia.org', 'narodowcy.net', 'nczas.com', 'ndie.pl', 'neon24.pl', 'newsweb.pl', 'parezja.pl', 'pikio.pl', 'reporters.pl', 'wmeritum.pl', 'wolnosc24.pl', 'wolna-polska.pl', 'wprawo.pl', 'wsensie.pl', 'zmianynaziemi.pl', 'tysol.pl', 'onet.pl',  'tvn24.pl',  'newsweek.pl',  'wp.pl',  'tvp.info',  'oko.press'];

const articles = document.querySelectorAll('.article[data-type="link"] .fix-tagline .tag.create a.affect');

let highlighted = 0;
for (let i = 0; i < articles.length; i++) {
    const urlElement = articles[i];

    if (urlElement) {
        const websiteUrl = urlElement.getAttribute('href');
        if (isWebsiteBanned(websiteUrl)) {

        console.log(websiteUrl);
            articles[i].closest('li').classList.add("marketing-highlight");
            const title = articles[i].closest('.lcontrast.m-reset-margin');
            const ele = document.createElement('div');
            ele.innerHTML = 'UWAGA: Artykuł sponsorowany!';
            ele.classList.add('marketing', 'warning');
            title.prepend(ele);
            highlighted++;
        }

    }
}

if (highlighted > 0) {
console.info(`Podświetlono ${highlighted} onucowskich znalezisk`);
}

function isWebsiteBanned(websiteUrl) {
    if (!websiteUrl) {
        return false;
    }

    for (let i = 0; i < stopWebsites.length; i++) {
        if (websiteUrl.includes(stopWebsites[i]) && !websiteUrl.includes('www.wykop.pl')) {
            return true;
        }
    }
    return false;
}